window.bookSummaryJSON = "<p></p><p><b>There are no victors in war</b></p><p>That's the refrain that goes through Matt Fang's mind. With losses mounting, not just among his units but his Heroes too, Matt is struggling with confidence and the mounting pressure. That's, of course, when a ship is sighted on the horizon; opening up a whole new front.</p><p>In the final volume of the Magic Kingdom at War series, Matt is about to learn the reason why. Whether it's enough, well... even he's not certain.<br><br><i>Magic Kingdom at War</i> is a tactical, base-building, crunchy LitRPG novella series by Tao Wong, bestselling author of the<i> System Apocalypse, A Thousand Li, Climbing the Ranks,</i> the <i>Hidden Universe</i> and <i>Adventures on Brad </i>series.</p><p></p>"; 
